<p>غەربىي يۇرت يولى كوچا باشقارمىسى <ref target="https://ug.wikipedia.org/wiki/قەشقەر_ۋىلايىتى">قەشقەر ۋىلايىتى</ref> نىڭ <ref target="https://ug.wikipedia.org/wiki/قەشقەر_شەھىرى">قەشقەر شەھىرى</ref> دىكى بىر كوچا باشقارمىسى بولۇپ، تارمىقىدا  مەھەللە بار، ئومۇمىي نوپۇسى مىڭ.</p>
